import React from 'react';

function Cardz(propz) {
    return ( 
    <div className = "contact" onClick = { () => {console.log("hi")}}>
      <p>{propz.id}</p>  
      <p>{propz.name}</p>
      <p>{propz.tel}</p>
      <p>{propz.email}</p>
    </div>
    );
  }
  
export default Cardz;
